export default function Elements({ className, srcImage, setUserChoice }) {
  return (
    <div>
      <div
        className={"circle circle--"+className}
        onClick={(e) => setUserChoice(e?.target.className)}
      >
        <img className={className} src={srcImage} />
      </div>
    </div>
  );
}
